import React from 'react'
import { Link } from 'react-router-dom';

function Header() {

    let arr = [
        {
            link : "link1"
        },
        {
            link : "link2"
        },
        {
            link : "link3"
        },
        {
            link : "link4"
        }
    ];

    return (
        <div>
           <div className="nav">
               
                                   <ul>
                                   <li>
                                        <Link to="/">
                                            <a href="">Anasayfa</a>
                                        </Link>
                                   </li>
                                   {arr > 0 && arr.map(item => {
                                   <li>
                                        <Link to="/{item.link}">
                                            <a href="">{item.link}</a>
                                        </Link>
                                   </li>
                                    })}
                            </ul>
            </div>
        </div>
    )
}

export default Header;
